class Solution:    def numUniqueEmails(self, emails):        """        :type emails: List[str]        :rtype: int        """        n = len(emails)        if n == 0:            return 0        res = set()        for email in emails:            names = email.split("@")            local, domain = names[0], names[1]            local = local.split("+")[0]            local = "".join(local.split("."))            res.add((local, domain))        return len(res)s=Solution()N=5print(s.beautifulArray(N))